import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import ChatItem from './Pages/Inbox/ChatItem/ChatItem'
import Message from "./Message/Message";

const root = ReactDOM.createRoot(document.getElementById('root'));

const Items = [
    { name: 'Serega', id: '1' },
    { name: 'Lisa', id: '2' },
    { name: 'Masha', id: '3' },
    { name: 'Kate', id: '4' },
    { name: 'Artyom', id: '5' },
    { name: 'Erich', id: '6' }
]

const Messages = [
    { id: '1', text: '- It\'s not easy to live your own way.' },
    { id: '2', text: 'Because you can\'t blame anybody but yourself.' },
    { id: '2', text: '- I don\'t want to be a burden! I want to be useful.' }
]

const i = Items.map((object, i) => <ChatItem key={i} name={object.name} id={object.id} />)
const m = Messages.map((message, i) => <Message key={i} id={message.id} text={message.text} />)


root.render(
    <App i={i} m={m} />
);
